import React from 'react';
import { withRouter, Link } from 'react-router-dom';
import './menu.scss';
import { Menu } from 'antd';
const { SubMenu } = Menu;
class MenuCom extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }
  render() {
    const flag = window.localStorage.getItem('flag')
    return (
      <div className="menu" style={{ width: 200 }}>
        <div className="menu-title">
          <div className="title-img">
            <img src="https://dss1.bdstatic.com/70cFuXSh_Q1YnxGkpoWK1HF6hhy/it/u=3238317745,514710292&fm=26&gp=0.jpg" alt=""/>
            <div>
              <p>Welcome</p>
              <p>Dr.Lara</p>
            </div>
          </div>
          <p className="general">GENERAL</p>
        </div>
        <Menu
          defaultSelectedKeys={['1']}
          mode="inline"
          theme="dark"
        >
          <Menu.Item key="1"><Link to="/home">Checkin</Link></Menu.Item>
          <Menu.Item key="2"><Link to="/home/appointment">Appointment</Link></Menu.Item>
          <Menu.Item key="3"><Link to="/home/profile">Profile</Link></Menu.Item>
          { flag == '1' && <Menu.Item key="4"><Link to="/home/appointtmonts">Appointtmonts</Link></Menu.Item>}
          { flag == '1' && <Menu.Item key="5"><Link to="/home/doctor">Doctor</Link></Menu.Item>}
        </Menu>
      </div>
    );
  }
}

export default withRouter(MenuCom);
